// //  create autocom

function autoText(result) {
  autocomplete.textContent = " "
  for (var i = 0; i < 20; i++) {
    const divCh = document.createElement("div");
    divCh.setAttribute("class", "autoLiks")
    const divA = document.createElement("a");
    divA.setAttribute("class", "auto_anchor");
    divA.textContent = result[i].item;
    autocomplete.append(divCh);
    divCh.append(divA);
  }
  throttle(listremove(), 500);
}

// throttling function 

  function throttle(fun, delay) {
    let timeout = null;
    return function (...args) {
      if (!timeout) {
        timeout = setTimeout(() => {
          fun.call(this, ...args);
          timeout = null;
        }, delay);
      }
    }
}

// remove list 
function listremove() {
  const autocomplete_list = document.querySelectorAll(".autoLiks");
  autocomplete_list.forEach(item => {
    item.addEventListener("click", (e) => {
      window.location.assign("post/" + e.target.innerText + ".html");
      e.target.parentNode.textContent = "";
    })
  })
}



searchData.addEventListener("keydown", e => {
  addTabActive(e);
})

function addTabActive(e)
{
  autoLiks = document.querySelectorAll(".autoLiks")
  if (e.keyCode == 40) {
    if (currentFocus <= autoLiks.length-2) {
      currentFocus++;
      addtabActive(autoLiks);
    }
  }
  if (e.keyCode == 38) {
    if (currentFocus >= 1) {
      currentFocus--;
      addtabActive(autoLiks,false);
    }
  }
  if (e.keyCode == 13) { 
    if(searchData.value == ""){
      alert("please enter value")
    }
    console.log(currentFocus)
    if (currentFocus >= 0) {
        if (window.location.href.indexOf('post') == -1) {
          window.location.assign("post/" + autoLiks[currentFocus].children[0].innerText + ".html");
        } else {
          window.location.assign(autoLiks[currentFocus].children[0].innerText + ".html");
        }
          e.preventDefault();
    } else
    {
      alert("please select word")
    }
  } 
}

function addtabActive(autoLiks, inc = true) {
  console.log(autocomplete.scrollTop)
  if (inc) {
        if (currentFocus > 0) {
          x += 30;
        autocomplete.scroll(0,x);
      }
    if (currentFocus!==0){
      autoLiks[currentFocus - 1].classList.remove("tabActive");
    }
  } else {
    if (currentFocus <= currentFocus+0) {
      x -= 30;
      autocomplete.scroll(0, x);
      } 
    autoLiks[currentFocus+1].classList.remove("tabActive");
  }
  autoLiks[currentFocus].classList.add("tabActive");
  searchData.value = autoLiks[currentFocus].children[0].innerText;
}

